import React from 'react';
import { motion } from 'framer-motion';

const Projects = () => {
  const projects = [
    {
      title: "Email Spam Classification",
      description: "Built a machine learning model using Support Vector Machine (SVM) to classify emails as spam or legitimate with high accuracy.",
      tech: ["Python", "Scikit-learn", "SVM", "TF-IDF", "Pandas"]
    },
    {
      title: "Bé Tí - Vietnamese Water Puppetry App",
      description: "Developed an interactive mobile application that brings traditional Vietnamese water puppetry to life using AI and voice technology. Winner of Top 10 at UEH BizTech Hackathon 2025.",
      tech: ["Gemini API", "Speech-to-Text", "Text-to-Speech", "Mobile Development"]
    },
    {
      title: "Power BI Revenue Analytics Dashboard",
      description: "Created an end-to-end Power BI dashboard with comprehensive insights and recommendations on revenue growth. Achieved Top 20 and Judge's Choice Award.",
      tech: ["Power BI", "DAX", "Data Modeling", "Business Intelligence"]
    },
    {
      title: "Haskell Memory Game",
      description: "Developed a console-based memory game using functional programming principles in Haskell.",
      tech: ["Haskell", "Functional Programming", "Game Logic"]
    }
  ];

  return (
    <motion.div
      className="page-container"
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.6 }}
    >
      <h1 className="page-title">My Projects</h1>

      <div className="projects-grid">
        {projects.map((project, index) => (
          <div key={index} className="project-card">
            <h3 className="project-title">{project.title}</h3>
            <p className="project-description">{project.description}</p>
            <div className="project-tech">
              {project.tech.map((tech, i) => (
                <span key={i} className="tech-tag">{tech}</span>
              ))}
            </div>
          </div>
        ))}
      </div>
    </motion.div>
  );
};

export default Projects;
EOF
